import React, { useState } from 'react'
import {
    HeroContainer,
    HeroTitleRight,
    VideoBg,
    ImageBg,
    ArrowForward,
    Row,
    HeroP,
    HeroTitle,
    HeroBtnWrapper,
    ArrowRight, Mockup, ColumnLeft, ColumnRight
} from '../WheelyApp/WheelyAppElements'
import { Button } from '../../Utilities/ButtonElements'
import Video from '../../Videos/video.mp4'
import mockup from '../../Images/profile.svg'
import mockup1 from '../../Images/garag.svg'


const WheelyApp = () => {

    const [hover, setHover] = useState(false);

    const onHover = () => {
        setHover(!hover);
    }


    const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1
    };
    return (
        <div>
            <h2> Single Item</h2>
            <Slider {...settings}>
                <div>
                    <h3>1</h3>
                </div>
                <div>
                    <h3>2</h3>
                </div>
                <div>
                    <h3>3</h3>
                </div>
                <div>
                    <h3>4</h3>
                </div>
                <div>
                    <h3>5</h3>
                </div>
                <div>
                    <h3>6</h3>
                </div>
            </Slider>
        </div>
    );
}

export default WheelyApp
